import React from 'react';
//import ReactDOM from 'react-dom';
import 'bulma/css/bulma.css'
import axios from 'axios' 


const List = () =>{
    let _list = []
    // const _data = [1,2,3,4,5,6,7,8]
    //  console.log(_data);
        axios.get('https://xo3dnghur7.execute-api.us-east-2.amazonaws.com/dev/registration_app_get_check_in_details?event_id=testkonfhubslsdeploymentb29912c5')
        .then(function (response) {
          // handle success
          console.log(response.data);
           _list = response.data;
        })
        .catch(function (error) {
          // handle error
          console.log(error);
        })
        .finally(function () {
          // always executed
          console.log(_list);
        });


        return(
                    <div className="list is-hoverable">
                    {
                        _list.map(person => {
                            console.log(person);
                            return(
                                <a className="list-item">{person[0].name}</a>
                            )
                        })
                    }
                    </div>
             )


}

export default List
